        <>
            <Grid item lg={4} md={4} sm={4} xs={12}>
                <Avatar imgProps={{ style: { borderRadius: "50%" } }} src={ClientAvatar} style={{ height: "8rem", width: "8rem", border: "1px solid grey", padding: ".3rem", margin: "1rem 0" }} />
                <Typography variant="h6">Lorem ipsum dolor sit amet consectetur adipisicing elit. Veniam ea tempore sequi ad nemo at ratione esse ipsam obcaecati. Voluptatibus labore praesentium tempora? Sequi iure, dolorum assumenda labore est odio.</Typography>
            </Grid>
        </>
    )
}

